#include<stdio.h>
#include<conio.h>
#include<stdlib.h>
void linsearch(int array[10],int number,int key);
void binsearch(int array[10],int number,int key);
void search(int key,int number,int array[10]);
void sort(int array[10],int number);

void main()
{
int array[100],key,c,number,n;
clrscr();
printf("Enter the number of elements in array\n");
scanf("%d",&number);
printf("Enter %d numbers\n",number);
for(c=0;c<number;c++)
	scanf("%d",&array[c]);
printf("Enter the number to search\n");
scanf("%d",&key);
while(1)
{
printf("\n 1.linear search \n 2.Binary search \n 3.exit ");
printf("\n Enter your choice:");

scanf("%d",&n);
switch(n)
{
case 1:
	printf("\n linear search \n");
	linsearch(array,number,key);
	break;
case 2:
	printf("\n binary search \n");
	binsearch(array,number,key);
	break;
case 3:
	printf("enter 3 to exit");
	exit(0);
default:
	printf("invallid");
	break;
}
getch();
}
}

void linsearch(int array[],int number,int key)
{
int c;
for(c=0;c<number;c++)
{
if(array[c]==key)
{
printf("%d is present at location %d \n",key,c+1);
search(key,number,array);
break;
}
}
if(c== number)
printf("%d is not present in array \n",key);
}

void binsearch(int array[],int number,int key)
{
int first =0;
int last=number-1;
int mid=(first+last)/2;
while((first<=last)&&(array[mid]!=key))
{
if(key<array[mid])
last=mid-1;
else
first=mid+1;
mid=(first+last)/2;
}

if(array[mid]==key)
{
printf("\n\n ITEM found at location %d",mid+1);
search(key,number,array);
}
else
{
printf("\n\n ITEM does't exist");
}
}

void search(int key,int number,int array[])
{
int i=0,counter=0;
for(i=0;i<number;i++)
{
if(key==array[i])
counter++;
}
printf("\n occurace of the entered number%d",counter);
}
void sort(int array[],int number)
{
int temp,i,j;
for(i=0;i<number;j++)
{
for(j=i+1;j<number;j++)
{
if(array[i]>array[j])
{
temp=array[i];
array[i]=array[j];
array[j]=temp;
}
}
}
printf("Elements sorted in ascending order are \n");
for(i=0;i<number;i++)
{
printf("%d",array[i]);
}
}

#include<stdio.h>
#include<stdlib.h>
//#include<conio.h>
#define max 7
void push();
void pop();
void display();
static int top=-1;
int stack[max-1];
int item;
int main()
{
int choice;
//clrscr();
do{
printf("\n1.push\n2.pop\n3.display\n0.exit\n");
printf("Enter your choice:");
scanf("%d",&choice);
switch(choice)
{
case 1:
	printf("push\n");
	push();
	break;
case 2:
	printf("pop\n");
	pop();
	break;
case 3:
	printf("display\n");
	display();
	break;
case 0:
	printf("Exit");
	break;
default:
	printf("invallid");
}
}while(choice!=0);
//getch();
}

void push()
{
if(top==max-1)
{
printf("stack is full\n");
}
else
{
printf("Enter the number to be inserted:");
scanf("%d",&item);
top++;
stack[top]=item;
}
}

void pop()
{
if(top==-1)
{
printf("stack is underflow\n");
}
else
{
printf("poped element is %d",stack[top]);
top--;
}
}
void display()
{
if(top!=-1)
{
for(int i=top;i>=0;i--)
{
printf("STACK[%d]=%d\n",i,stack[i]);
}
}
else
{
printf("stack is empty");
}
}
